				// 			title:"请微信授权",
				// 			icon:'none',
				// 			duration:1500
				// 		})
				// 	}
				//   },
				//   fail(res){
				//     console.log(res,'登录过期了')
				//     uni.showModal({
				//       title: '提示',
				//       content: '你的登录信息过期了，请重新登录',
				//     })
				// 	wx.login({
				// 	    success: function (res) {
				// 	      console.log(res.code)
				// 	      //发送请求
				// 	      wx.request({
				// 	        url: 'https://zct.51kdd.com/index.php', 
				// 	        data: {
				// 	          code: res.code
				// 	        },
				// 	        header: {
				// 	          'content-type': 'application/json' // 默认值
				// 	        },
				// 	        success(res) {
				// 	          console.log(res)
				// 	        }
				// 	      })
				// 	    }
				// 	})
				// }
		  //   })
				
			},
			lower(){
				if (this.loadingType == 2) {
					return
				}
				this.requestLearnList(false)
			}
	    },
    }
